// src/pages/Home.js
import React from 'react';
import ProductList from '../Components/ProductList';
import products from '../data';

const Home = () => (
  <div>
    <h1>Welcome to the Store</h1>
    <ProductList products={products} />
  </div>
);

export default Home;
